import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Home';
import AddTask from './pages/AddTask';
import OptimalPlan from './pages/OptimalPlan';
import UploadNotes from './pages/UploadNotes'; // Import UploadNotes component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/add-task" element={<AddTask />} />
        <Route path="/optimal-plan" element={<OptimalPlan />} />
        <Route path="/upload-notes" element={<UploadNotes />} /> {/* Add route */}
      </Routes>
    </Router>
  );
}

export default App;
